import "./App.css";
import { faCircleCheck } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function Card() {
  return (
    <div className="Card">
      <FontAwesomeIcon icon={faCircleCheck} size="2xl" class="check-btn"/>
    </div>
  );
}

export default Card;
